  summary: Defines the interface that associates a duplex channel with a session.
  remarks: "The [IDuplexSessionChannel](xref:CoreWCF.Channels.IDuplexSessionChannel) interface indicates that an [IDuplexChannel](xref:CoreWCF.Channels.IDuplexChannel) implements [IDuplexSession](xref:CoreWCF.Channels.IDuplexSession) semantics.\n\n
            Given an [IDuplexSessionChannel](xref:CoreWCF.Channels.IDuplexSessionChannel), its associated [IDuplexSession](xref:CoreWCF.Channels.IDuplexSession) can be retrieved through the [Session](xref:CoreWCF.Channels.ISessionChannel`1.Session) property."
